**Statement 1:** If G, H, and K are groups of order 4, at least two of them are isomorphic.

Groups of order 4 are isomorphic to either \(\mathbb{Z}_4\) or \(\mathbb{Z}_2 \times \mathbb{Z}_2\). There are only two isomorphism classes. With three groups and two classes, by the pigeonhole principle, at least two must be isomorphic.

Thus, Statement 1 is true.

**Statement 2:** If \(\mathbb{Z}_r \oplus \mathbb{Z}_s\) is isomorphic to a subgroup of \(\mathbb{Z}_m \oplus \mathbb{Z}_n\), then r divides m and s divides n.

Consider \(\mathbb{Z}_2 \oplus \mathbb{Z}_4\), which is isomorphic to \(\mathbb{Z}_4 \oplus \mathbb{Z}_2\). \(\mathbb{Z}_2 \oplus \mathbb{Z}_4\) is isomorphic to a subgroup of \(\mathbb{Z}_4 \oplus \mathbb{Z}_2\) (itself). Here, r=2, s=4, m=4, n=2. r divides m (2 divides 4), but s does not divide n (4 does not divide 2).

Thus, Statement 2 is false.

\[
\boxed{
\begin{pmatrix} 
\text{Statement} \\ 1 \\ \text{is} \\ \text{true} \\ & \\ \text{Statement} \\ 2 \\ \text{is} \\ \text{false}
\end{pmatrix}
}
\]

**Statement 1:** Every group of order 159 is cyclic.  
The prime factorization of 159 is \(159 = 3 \times 53\), where 3 and 53 are distinct primes. Since 3 does not divide \(53 - 1 = 52\), every group of order 159 is cyclic. Thus, Statement 1 is true.

**Statement 2:** Every group of order 102 has a nontrivial proper normal subgroup.  
The prime factorization of 102 is \(102 = 2 \times 3 \times 17\). The number of Sylow 17-subgroups divides \(102 / 17 = 6\) and is congruent to 1 modulo 17. The possible values are 1 or divisors of 6 that are 1 modulo 17. Only 1 satisfies this, so the Sylow 17-subgroup is normal and has order 17, which is nontrivial and proper. Thus, Statement 2 is true.

\[
\boxed{
\begin{pmatrix} 
\text{true} \\ 
\text{true} 
\end{pmatrix}
}
\]

**Statement 1:** There exists a free abelian group of every positive integer rank.  
For any positive integer \(n\), the group \(\mathbb{Z}^n\), which is the direct sum of \(n\) copies of \(\mathbb{Z}\), is a free abelian group of rank \(n\). Therefore, Statement 1 is true.

**Statement 2:** A finitely generated abelian group is free abelian if its Betti number equals the number of elements in some generating set.  
The Betti number of a finitely generated abelian group is the rank of its free part. For a group \(G = \mathbb{Z}^r \oplus T\), where \(T\) is the torsion subgroup, the Betti number is \(r\). If \(G\) is not free (i.e., \(T\) is non-trivial), then every generating set has more than \(r\) elements. Thus, if there exists a generating set with exactly \(r\) elements, \(G\) must be free abelian, as this is only possible when \(T\) is trivial. Therefore, Statement 2 is true.

\[
\boxed{
\begin{pmatrix} 
\text{Statement} \\ 1 \\ \text{is} \\ \text{true} \\ 
& \\ 
\text{Statement} \\ 2 \\ \text{is} \\ \text{true} 
\end{pmatrix}
}
\]

Statement 1: A ring homomorphism is one-to-one if and only if its kernel is {0}. This is a standard theorem in ring theory, so Statement 1 is true.

Statement 2: Q is an ideal in R. Assuming Q refers to the rational numbers and R refers to the real numbers, Q is not an ideal in R. For example, √2 is in R but not in Q, and √2 * 1 = √2, which is not in Q. Thus, Statement 2 is false. 

Final answer:  
\[
